    /*** ================= TOAST & POPUP UI ================= ***/
    function createToastContainer() {
        let container = document.getElementById('rox-toast-container');
        if (!container) {
            container = document.createElement('div');
            container.id = 'rox-toast-container';
            container.style.position = 'fixed';
            container.style.top = '20px';
            container.style.right = '20px';
            container.style.zIndex = 99999;
            container.style.display = 'flex';
            container.style.flexDirection = 'column';
            container.style.gap = '10px';
            document.body.appendChild(container);
        }
        return container;
    }

    function showToast(message, type = 'info', duration = 3000) {
        const container = createToastContainer();
        const toast = document.createElement('div');
        toast.textContent = message;
        toast.style.padding = '10px 20px';
        toast.style.borderRadius = '8px';
        toast.style.backgroundColor = type === 'error' ? '#f56565' : '#48bb78';
        toast.style.color = '#fff';
        toast.style.fontSize = '14px';
        toast.style.boxShadow = '0 2px 8px rgba(0,0,0,0.2)';
        toast.style.opacity = '0';
        toast.style.transition = 'opacity 0.3s ease';
        container.appendChild(toast);
        requestAnimationFrame(() => { toast.style.opacity = '1'; });
        setTimeout(() => {
            toast.style.opacity = '0';
            setTimeout(() => toast.remove(), 300);
        }, duration);
    }

    function showKeyPrompt(realKey, callback) {
        const overlay = document.createElement('div');
        overlay.style.position = 'fixed';
        overlay.style.top = 0;
        overlay.style.left = 0;
        overlay.style.width = '100%';
        overlay.style.height = '100%';
        overlay.style.backgroundColor = 'rgba(0,0,0,0.6)';
        overlay.style.display = 'flex';
        overlay.style.alignItems = 'center';
        overlay.style.justifyContent = 'center';
        overlay.style.zIndex = 999999;

        const box = document.createElement('div');
        box.style.background = '#303a69';
        box.style.padding = '30px';
        box.style.borderRadius = '12px';
        box.style.boxShadow = '0 4px 20px rgba(0,0,0,0.3)';
        box.style.display = 'flex';
        box.style.flexDirection = 'column';
        box.style.alignItems = 'center';
        box.style.minWidth = '300px';
        box.style.color = '#fff';

        const text = document.createElement('div');
        text.textContent = 'Nhập KEY để truy cập:';
        text.style.marginBottom = '15px';
        box.appendChild(text);

        const input = document.createElement('input');
        input.type = 'text';
        input.style.padding = '10px';
        input.style.borderRadius = '6px';
        input.style.border = '1px solid #ccc';
        input.style.width = '100%';
        input.style.marginBottom = '15px';
        box.appendChild(input);

        const btn = document.createElement('button');
        btn.textContent = 'Xác nhận';
        btn.style.padding = '10px 20px';
        btn.style.border = 'none';
        btn.style.borderRadius = '6px';
        btn.style.backgroundColor = '#48bb78';
        btn.style.color = '#fff';
        btn.style.cursor = 'pointer';
        btn.addEventListener('click', () => {
            const val = input.value.trim();
            document.body.removeChild(overlay);
            callback(val);
        });
        box.appendChild(btn);

        overlay.appendChild(box);
        document.body.appendChild(overlay);
    }

